import React from "react";
import BooStrap from "./Header";
import "./../../css/header.css";

export default function index() {
  return (
    <div>
      <nav className="nav">
        <div className="menubar">
          <ul>
            <li>รายการสด</li>
            <li><ul><li></li></ul></li>
            <li></li>
            <li></li>
            <li></li>
          </ul>
        </div>
      </nav>
      <BooStrap />
    </div>
  );
}
